import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import Header from './Pages/Header';
import { BookProvider } from './Contexts/Book';


function App() {
  return (
    <BookProvider>
      <Router>
        <div className="App">
          <Header />
        </div>
      </Router>
    </BookProvider>
  );
}

export default App;
